    "2013-03-14T19:25:30.640911",nt"name": "san-francisco-pacifica-coast-landslide-susceptibility-2011a00dd",nt"isopen":
    false,nt"url": null,nt"notes": "The San Francisco-Pacifica Coast grid map
    was extracted from the California Geological Survey Map Sheet 58 that covers the
    entire state of California and originally published in May of 2011. It made use
    of several data layers such as Landslide Inventory, Geology, Rock Strength and Slope
    of varying scales and formats. For the statewide analysis of landslide susceptibility,
    the methodology of Wilson and Keefer (1985) was used in combining the rock strength
    and slope data layers as implemented by Ponti, el al. (2008) to create classes of
    landslide susceptibility. These classes express the generalization that on very
    low slopes, landslide susceptibility is low even in weak materials, and that landslide
    susceptibility increases with slope and in weak rocks.Dataset was submitted to CSMW
    as part of the San Francisco Littoral Cell Coastal Regional Sediment amanagement
    Plan (2012).",nt"license_title": null,nt"extras": [{ntt"key": "responsible-party",ntt"value":
